import React from 'react';
import { Button } from '@mui/material';
import LocalMallIcon from '@mui/icons-material/LocalMall';
import Login from './Login';
import Signup from './SignUp';

function Header() {
    function Loginfun() {
        return (
            <div>
                Me Pagle Hu
                <div className="mb-3 row">
                    <label for="staticEmail" className="col-sm-2 col-form-label">Email</label>
                    <div className="col-sm-10">
                        <input type="text" readonly className="form-control-plaintext" id="staticEmail" value="email@example.com" />
                    </div>
                </div>
                <div className="mb-3 row">
                    <label for="inputPassword" className="col-sm-2 col-form-label">Password</label>
                    <div className="col-sm-10">
                        <input type="password" className="form-control" id="inputPassword" />
                    </div>
                </div>
            </div>
        )
    }
    function SignUpfun() {
        return <Signup />
    }
    return (
        <div>
            <nav classNameName="navbar navbar-expand-lg navbar-light bg-info">
                <div classNameName="container-fluid">
                    <a classNameName="navbar-brand" href="#"><LocalMallIcon />  LazyBuyer</a>
                    <button classNameName="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span classNameName="navbar-toggler-icon"></span>
                    </button>
                    <div classNameName="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul classNameName="navbar-nav me-auto mb-2 mb-lg-0">
                        </ul>
                        <div classNameName="d-flex">
                            <button classNameName="btn btn-primary" type="submit" style={{ marginRight: "10px" }} onClick={Loginfun}>Login</button>

                            {/* <button onClick={SignUpfun} classNameName="btn btn-primary" type="submit">Sign Up</button> */}
                        </div>
                    </div>
                </div>
            </nav>
        </div>
    )
}
export default Header;
